import React from "react";

function Card({ clickHandler, id, image, name }) {
  return (
    <div className="card-placement">
      <img
        src={image}
        alt={name}
        className="selected-card col-4"
        onClick={() => clickHandler(id)}
      />
    </div>
  );
}

export default Card;
